import React , { Component }  from 'react';
import "./Services.css";


class Services extends Component {
    render(){
        return(
            <div>
            <div className="service">
                <ul className="list-group list-group-flush">
                <h3> Assess your eligibility at no cost </h3>
                <ul className="list-group">
                  <li className="list-group-item"> Personal assessment of qualification</li>
                  <li className="list-group-item"> Email responses to your inquiries</li>
                  <li className="list-group-item"> Telephone or chat inquiries</li>  
                </ul>
                </ul>
                </div>
                <br/><br/>
                <div className="service1">
                <ul className=" list-group list-group-flush">
                <h3>  Area of Practices and Expertise </h3>
                <ul className="list-group">
                  <li className="list-group-item "> Manitoba Provincial Nominee Program </li>
                  <li className="list-group-item "> Email responses to your inquiries</li>
                  <li className="list-group-item"> Telephone or chat inquiries</li>  
                </ul>
                </ul>
                </div>
                
            </div>
        );
    }
}
export default Services;
